public void setListSelection( String value ) 
{
	for( int i = 0; i < getJList().getModel().getSize(); i++ )
	{
		if( getJList().getModel().getElementAt( i ).toString().equalsIgnoreCase( value ) )
		{
			getJList().setSelectedIndex( i );
			break;
		}
	}
	
}
